import React from "react";



const Match = (props) =>
{
   
       return (
            <>
                <div className='slot_style'>
                    <h1>
                        {x} {y} {z}
                    </h1>
                    <h1>This is Matching</h1>
                </div>
            </>
        );
     
    }

    export default Match;
